query GetAuction($address: String!, $name: String!) {
  auctionByAddressAndName(address: $address, name: $name) {
    address
    name
    price
    bidStartBlock
    mintStartBlock
    maxUnits
    chainId
    bidsByAuctionAddressAndAuctionName {
      totalCount
      __typename
    }
    __typename
  }
}

