query GetAuctionUnsettledBidsCount($address: String!, $name: String!) {
  auctionByAddressAndName(address: $address, name: $name) {
    bidsByAuctionAddressAndAuctionName(condition: {status: SUBMITTED}) {
      totalCount
      __typename
    }
    __typename
  }
}

